import React, { useState } from 'react';
import './App.css';

function App() {
  const [hobbies, setHobbies] = useState([
    { id: 1, name: 'Pedalada', local: 'Abreu e Lima', data: "15/06/1999" },
    { id: 2, name: 'Socializar', local: "Ibura, Recife", data: "15/06/1999"},
    { id: 3, name: 'Caçar tatu na praia', local: "Itamaracá", data: "15/06/1999"},
  ]);

  return (
    <div className="Container">
      <h1>Próximos Hobbies</h1>
      <ul>
        {hobbies.map(hobbies => (
          <li key={hobbies.id}>
            <h3>{hobbies.name}</h3>
            <p>Local: {hobbies.local}-PE</p>
            <p>Data do evento: {hobbies.data}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
